 async (
    browser: Browser
): Promise<Page | undefined> => {
    const allPage = await browser.pages();
    const allPageTitle = await Promise.all(allPage.map(async (p) => p.title()));
    let indexOfIdlePage = allPageTitle.indexOf("");
    if (indexOfIdlePage === -1) {
        const idlePage = await getIdlePage(browser);
        return idlePage;
    }
    return allPage[indexOfIdlePage];
}
